import styles from './index.module.css';
import {connect} from 'react-redux'
import ActivitiesElem from '../ActivitiesElem/ActivitiesElem'
import fetchMAXIMIZING from '../../../actions/activities/activitiesList'

function ActivitiesList(props) {
    const {list} = props.list
    const expand = (id) => props.maximize(id)
    return (
        <div>
            {list.map(elem =>
                 <ActivitiesElem props={elem} expand={expand}>
                 </ActivitiesElem>)}
        </div>
    )
}

const mapStateToProps = (state) => {list: state}
const mapDispatchToProps = {
    maximize: (id) => fetchMAXIMIZING(id)
}
export default connect(mapStateToProps, mapDispatchToProps)(Activities);
